INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 0, 0, "お！\nあそこに困ってそうな人発見！", "春咲 ひより", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1001, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 0, 0, "大切な人を\n守れるようになりたい…って", "草野 優衣", "みんなみたいに\nわたしも強くならなきゃ", 1002, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "少しは磨かれると思いますよ。", 0, 0, 0, "キミに必要な集中力と感性が", "士条 怜", "フェンシングを始めてみては？", 1003, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.5, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 0, 0, "今日はなにして遊ぶ？", "穂高 みそぎ", "ねぇ、にいちゃん！", 1004, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "私といっしょに…\nいかない？", 0, 0, 0, "ねぇ…", "風宮 あかり", "風宮あかりです", 1006, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.5, "食べ物の恨みは怖いのー", 0, 0, 0, "プリンたべたいのー", "出雲 宮子", "出雲宮子なのー", 1007, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "いいよ。\n見られることは運命さ…", 0, 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", "虹村 雪", "ボクは虹村雪。", 1008, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "人呼んで「疾風の冥姫」!!", 0, 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "柊杏奈", "フッ…聞いて後悔するがいい！", 1009, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.5, "ほんまおおきにやわ～♪", 0, 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "姫宮 真歩", "マホマホ王国のプリンセス、\nまほ姫どす", 1010, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "ここで会ったが\n100年目～！", 0, 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲 璃乃", "衣之咲璃乃です！", 1011, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "…って、お願い！\n誰にも言わないでおいて～！", 0, 0, 0, "ち、超能力って…\n何のことかな～？", "柏崎 初音", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1012, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 0, 0, "一応カリスマ読モJKやってまっす！", "美波 鈴奈", "ちょす！\n美波鈴奈だよ～♪", 1016, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "でも、沖縄もとってもいいとこさー", 0, 0, 0, "東京は遊園地みたいなところさー", "喜屋武 香織", "はいたーい。\n喜屋武香織さー。", 1017, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "イオちゃんって呼んでね。", 0, 0, 0, "先生って呼ばれるのは\nくすぐったいから", "支倉 伊緒", "支倉伊緒です。", 1018, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.5, "ミミをおいてかないでぇ～", 0, 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", "茜 ミミ", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1020, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.5, "ふぇぇぇぇぇん……", 0, 0, 0, "あの……\nふぇ……", "栗林 くるみ", "あ…あの…えっと…\n栗…林…くるみ…です……", 1021, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "なんてありがとうございます！", 0, 0, 0, "こんな私に貴重な時間を\n割いていただき、", "風宮 より", "風宮よりです。\nあああああ！", 1022, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.5, "私こっち行きたいー\nね、早く早くー", 0, 0, 0, "おにいちゃんどこいくの？\nえ？", "北条 綾音", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1023, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "これて何か違う…\nあああすみません！", 0, 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", "天野 すずめ", "わっ…わっ…私、\n天野すずめといいます！", 1025, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "離しませんわ………\n絶対に…!!", 0, 0, 0, "あなたは…運命の……\n伴侶……", "倉石 恵理子", "……クスクス…私は\n…倉石恵理子……", 1027, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "…そうでしょ？？", 0, 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木 咲恋", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1028, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "あはは、\n私もまだまだだなぁ～", 0, 0, 0, "ぇっと…\nキミ、私のこと知らないの?!", "桜井 望", "桜井望だよ！\nよろしくねっ", 1029, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", "ニノン・ジュベール", "デケデケデンっ！", 1030, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "おかしいですね……", 0, 0, 0, "でもって私の隣にいるのが……\nえ、見えない？", "上喜 しのぶ", "上喜しのぶです。\n手元のドクロが父です。", 1031, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.5, "そう、\nオラのボケに突っ込める相方が…！", 0, 0, 0, "けんども\nそれには足りないモンが…", "野戸まひる", "目指すはビッグな\nお笑い芸人だっぺ！", 1033, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "ちょ\nちょっと一杯飲んできます…！", 0, 0, 0, "ちょっと緊張しちゃって…", "綾瀬 ゆかり", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1034, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.5, "これ以上お話しすることは…\nないです！", 0, 0, 0, "知らない人とは話しちゃいけないので", "氷川 鏡華", "氷川鏡華…です", 1036, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 0, 0, "……あ、アラーム。", "柏崎 栞", "柏崎…栞です。", 1038, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "野に咲く花が、\n唯一の話相手です。", 0, 0, 0, "私、一人も友達がいなくて……", "双葉 碧", "ふ、双葉碧です。", 1040, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "そう思っています。", 0, 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角 千歌", "三角千歌です。", 1042, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "う、疑ってすまなかったな…", 0, 0, 0, "あぁ？\nお前のそいつの仲間か？", "安芸 真琴", "安芸真琴だ。", 1043, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 0, 0, "生けとし生ける全ての者よ！", "イリヤ・オーンスタイン", "わらわこそは夜を総べる者！", 1044, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "ｌク、クウカに何かご用ですか!?", 0, 0, 0, "ぐふふふふ……はっ！", "遠見 空花", "そこで騎士は妖精を乱暴に……", 1045, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまき", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1046, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 0, 0, "それでは早速クエストに…", "大神 美冬", "大神美冬よ！", 1048, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 0, 0, "クエストもバトルも\n掃除も洗濯も", "星野静流", "星野静流だよ！", 1049, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.5, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 0, 0, "見ての通りの\nセクシー美少女で", "玉泉美咲", "アタシは玉泉美咲。", 1050, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.4, "？？？？", 0, 0, 0, "？？？？", "リマ", "？？？", 1052, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.5, "そ、そこまでいうなら\nもらってやる", 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィント", "モニカ・ヴァイスヴィントだ。", 1053, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.5, "そ、そこまでいうなら\nもらってやる", 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", "ペコリーヌ", "モニカ・ヴァイスヴィントだ。", 1058, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.5, "そ、そこまでいうなら\nもらってやる", 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", "コッコロ", "モニカ・ヴァイスヴィントだ。", 1059, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, 1, 2, 1, 1.5, "そ、そこまでいうなら\nもらってやる", 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", "キャル", "モニカ・ヴァイスヴィントだ。", 1060, 0);
